import React from "react";
import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

export default function Home() {
    return (
        <div>
            <div><Navbar /></div>

            <div>
                <div className="card mt-3" style={{ width: "18rem", "maxHeight":"160px"}}>
                    <img className="card-img-top" src="..." alt="Food card" />
                    <div className="card-body">
                        <h5 className="card-title">Card title</h5>
                        <p className="card-text">
                            Food description and price.
                        </p>
                        <div className="container w-100">
                            <select className="m-2 h-100 bg-success rounded">
                                {Array.from(Array(6),(e,i) => {
                                    return(
                                        <option key={i+1} value={i+1}>{i+1}</option>
                                    )
                                })}
                            </select>

                            <select className="m-2 h-100 bg-success rounded">
                                <option value='half'>Half</option>
                                <option value='ful'>Full</option>
                            </select>

                            <div className="d-inline h-100 fst-bold">Total Price</div>
                        </div>
                    </div>
                </div>
            </div>
            <div>
                <Footer />
            </div>
        </div>
    );
}
